import React, { useState } from 'react';
import './About.modules.css';

export const About = () => {
  const [imageName, setImageName] = useState('brian123.jpg');

  const changeImage = () => {
    setImageName('dynamic-image.jpg');
  };

  return (
    <div className='about'>
      <h1>Brian Gelvez</h1>
      <h2>Full Stack Developer</h2>
      <h2>Estudiante Henry</h2>
      <img src={require(`../../assets/img/${imageName}`).default} alt="Loading..." />
      <button onClick={changeImage}>Change Image</button>
    </div>
  );
};
